		$ChannelOperate->prepare_status = '200';
		$ChannelOperate->operate_time = date('Y-m-d',time());
		$ChannelOperate->save();
			DB::commit();
			return true;
		}catch (\Exception $e)
		{
			DB::rollBack();
			LogHelper::logChannelError([$return_data, $prepare], $e->getMessage(), 'addOrder');
			return false;
		}
	}


